import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Apply price sort filter
    await page.waitForSelector('select.search-category', { timeout: 5000 });
    await page.selectOption('select.search-category', 'Electronics');

    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    return {
      success: true,
      action: "Applied price sort filter and took screenshots",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
